  var c = a.getNumberValue("VALUE1", a), d = a.getNumberValue("VALUE2", a), e = a.getNumberValue("VALUE3", a);
  b = a.getNumberValue("VALUE4", a);
  a = a.getNumberValue("VALUE5", a);
  if (d > e) {
    var f = d, d = e, e = f;
  }
  b > a && (f = b, b = a, a = f);
  c = (a - b) / (e - d) * (c - d);
